    <div className="container-movies">
      <img src={props.element.Poster} alt="" />
      <div className="info">
        <div>
          <h3>{props.element.Title}</h3>
          <h4>{props.element.Year}</h4>
        </div>
        <div className="constrols">
          <button className="btn" onClick={()=>api.dispatch()}>add to whatchlist</button>
          <button className="btn">add to whatched</button>
        </div>
      </div>
    </div>
  );
}

